import React from "react";
import { Link } from "react-router-dom";
export const Navbar=()=>{
    return (
        <div>
          <header >
            <Link to="/">
              <img src="" alt="" />
            </Link>
            <ul>
                <li><Link to="/home">Pokedex</Link></li>
                <li><Link to="/create">Create</Link></li>
                <li><Link to="/team">My team</Link></li>
            </ul>
          </header>
        </div>
      );
}
